        initDataAjax: function() {
            var self = this;
            $(document).on('click', '[data-ajax]', function() {
                var that = $(this);
                var method = that.data('ajax');
                var url = that.data('url');
                var active = that.is('.active');
                var cancelText = that.data('lang-cancel');
                var attentText = that.data('lang-attent');
                var favoriteText = that.data('lang-favorite');
                var isRecomend = that.is('#topic-recomend-button');
                var isWiki = that.is('#topic-wiki-button');
                var ribbonContainer = $('.topic .ribbon-container');
                var ribbon = $('.topic .ribbon');
                var excellent = $('.topic .ribbon-excellent');
                var wiki = $('.topic .ribbon-wiki');
                var total = $('.replies .total b');
                var voteCount = $('#vote-count');
                var upVote = $('#up-vote');
                var downVote = $('#down-vote');
                var isVote = that.is('.vote');
                var isUpVote = that.is('#up-vote');
                var isDownVote = that.is('#down-vote');
                var isCommentVote= that.is('.comment-vote');
                var commenVoteCount= that.find('.vote-count');
                var emptyBlock = $('#replies-empty-block');
                var originVoteCount = voteCount.html();
                var originUpVoteActive = upVote.is('.active');
                var originDownVoteActive = downVote.is('.active');

                if (method === 'delete') {
                    swal({
                        title: "",
                        text: "Are you sure want to proceed?",
                        type: "warning",
                        showCancelButton: true,
                        cancelButtonText: "取消",
                        confirmButtonText: "删除"
                    }, function() {
                        that.closest('.list-group-item').slideUp();
                        $.ajax({
                            method: method,
                            url: url
                        }).done(function(data) {
                            if (data.status === 200) {
                                that.closest('.list-group-item').remove();
                                total.html(parseInt(total.html()) - 1);
                                if (parseInt(total.html()) === 0) {
                                    emptyBlock.removeClass('hide');
                                }
                            }
                        }).fail(function() {
                            that.closest('.list-group-item').show();
                        });
                    });

                    return;
                }

                if (that.is('.ajax-loading')) return;
                that.addClass('ajax-loading');

                if (active) {
                    that.removeClass('active');

                    if (attentText) {
                        that.find('span').html(attentText);
                    } else if (favoriteText) {
                        that.find('span').html(favoriteText);
                    }

                    if (isRecomend) {
                        excellent.hide();
                    } else if (isWiki) {
                        wiki.hide();
                    }

                    if (isVote) {
                        if (isUpVote) {
                            voteCount.html(parseInt(voteCount.html()) - 1);
                        } else if (downVote) {
                            voteCount.html(parseInt(voteCount.html()) + 1);
                        }
                    }
                } else {
                    that.addClass('active');

                    if (cancelText) {
                        that.find('span').html(cancelText);
                        self.showPluginDownload();
                    }

                    if (isRecomend) {
                        var excellentText = ribbonContainer.data('lang-excellent');
                        if (excellent.length) {
                            excellent.show();
                        } else {
                            if (ribbon.length) {
                                ribbon.prepend('<div class="ribbon-excellent"><i class="fa fa-trophy"></i> ' + excellentText + ' </div>');
                            } else {
                                ribbonContainer.prepend('<div class="ribbon"><div class="ribbon-excellent"><i class="fa fa-trophy"></i> ' + excellentText + ' </div></div>');
                            }
                        }
                    } else if (isWiki) {
                        var wikiText = ribbonContainer.data('lang-wiki');
                        if (wiki.length) {
                            wiki.show();
                        } else {
                            if (ribbon.length) {
                                ribbon.append('<div class="ribbon-wiki"><i class="fa fa-graduation-cap"></i> ' + wikiText + ' </div>');
                            } else {
                                ribbonContainer.append('<div class="ribbon"><div class="ribbon-wiki"><i class="fa fa-graduation-cap"></i> ' + wikiText + ' </div></div>');
                            }
                        }
                    }

                    if (isVote) {
                        if (isUpVote) {
                            if (downVote.is('.active')) {
                                downVote.removeClass('active');
                                voteCount.html(parseInt(voteCount.html()) + 2);
                            } else {
                                voteCount.html(parseInt(voteCount.html()) + 1);
                            }
                        } else if (downVote) {
                            if (upVote.is('.active')) {
                                upVote.removeClass('active');
                                voteCount.html(parseInt(voteCount.html()) - 2);
                            } else {
                                voteCount.html(parseInt(voteCount.html()) - 1);
                            }
                        }
                    }
                }

                $.ajax({
                    method: method,
                    url: url
                }).done(function(data) {
                    if (data.status === 200) {
                        if (isCommentVote) {
                            var num = parseInt(commenVoteCount.html());
                            num = isNaN(num) ? 0 : num;

                            if (data.type === 'sub') {
                                commenVoteCount.html(num - 1 < 1 ? '' : num - 1);
                            } else if (data.type === 'add') {
                                commenVoteCount.html(num + 1);
                            }
                        }
                    }
                }).fail(function() {
                    if (!active) {
                        that.removeClass('active');

                        if (attentText) {
                            that.find('span').html(attentText);
                        } else if (favoriteText) {
                            that.find('span').html(favoriteText);
                        }

                        if (isRecomend) {
                            excellent.hide();
                        } else if (isWiki) {
                            wiki.hide();
                        }
                    } else {
                        that.addClass('active');

                        if (cancelText) {
                            that.find('span').html(cancelText);
                        }

                        if (isRecomend) {
                            excellent.show();
                        } else if (isWiki) {
                            wiki.show();
                        }
                    }

                    if (isVote) {
                        voteCount.html(originVoteCount);

                        if (originUpVoteActive) {
                            upVote.addClass('active');
                        } else {
                            upVote.removeClass('active');
                        }

                        if (originDownVoteActive) {
                            downVote.addClass('active');
                        } else {
                            downVote.removeClass('active');
                        }
                    }
                })
                .always(function() {
                    that.removeClass('ajax-loading');
                });
            });
        },

        showMsg: function(msg, myobj) {
            if (!msg) return;

            var obj = myobj || {};
            var type = obj.type || 'info';
            var timer = obj.timer || 0;
            var tpl = '';

            tpl += '<div class="alert alert-' + type + ' alert-dismissible fade in" role="alert">';
            tpl +=    '<button type="button" class="close" data-dismiss="alert" aria-label="Close"><span aria-hidden="true">×</span></button>';
            tpl +=    '<i class="glyphicon glyphicon-info-sign"></i>' + msg;
            tpl += '</div>';

            if (!$('.cus-top-alert').length) {
                $(tpl).appendTo('body').wrap('<div class="cus-top-alert"></div>');
            } else {
                $('.cus-top-alert').html(tpl);
            }

            $('.cus-top-alert .alert').alert();

            if (timer) {
                setTimeout(function() {
                    $('.cus-top-alert .alert').alert('close');
                }, timer);
            }
        },

